import React, { useEffect } from 'react';
import "./Products.css";
import ProducctsService from '../../services/ProducctsService';
import { getProductsThunk } from './thunks';

export const Products = () => {

    useEffect(() => {
        getProductsThunk({ page: 1, limit: 20 }); then(response => {
            console.log(response);
        })
    }, [])
  return (
    <div>Products</div>
  )
};
